import React, {useState, useEffect, useContext} from "react"

function Clicker() {
    const [count, setCount] = useState(0);

    // this is what is going to be rendered
    return (
        <div>
            <p>Вы кликнули {count} раз</p>
            <button onClick={() => setCount(count + 1)}>
                Нажми на меня
            </button>
        </div>
    )
}
